class sleep extends Component{
render(){
    return(
        <div>
            <div>
               Sleep Stories
               <button>Click</button> </div>
            <div> Meditation for sleep
                <button>Click</button>
            </div>
            <div>Nature Sounds
                <button></button>
            </div>

        </div>
    )
}

}
export default sleep;
